open FSharp.Text.Lexing
open XMPar

let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

let keyword s =
    match s with
    | "char"    -> CHAR
    | "if"      -> IF
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "true"    -> CSTBOOL 1
    | "int"     -> INT
    | "null"    -> NULL 
    | "print"   -> PRINT
    | "println" -> PRINTLN 
    | "return"  -> RETURN 
    | "void"    -> VOID
    | "while"   -> WHILE
    | "double"  -> DOUBLE
    | _         -> NAME s

